import React from "react";
import "./SearchPopup.css";

const SearchPopup = () => {
  return (
    <form className="search-popup">
      <h3>Search</h3>
      <label>Destination</label>
      <input type="text"></input>
      <label>Check-in Date</label>
      <input type="date"></input>
      <div></div>
    </form>
  );
};

export default SearchPopup;
